    `updator`     varchar(32) COLLATE utf8_bin      DEFAULT NULL COMMENT '更新人',
    `del_flag`    int(11)                           DEFAULT '1' COMMENT '删除标识：0：删除 1：存在',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8
  COLLATE = utf8_bin;

