    `name`      varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '名称',
    `pcode`     varchar(64) COLLATE utf8_bin  DEFAULT NULL COMMENT '父编码',
    `system_sn` varchar(32) COLLATE utf8_bin  DEFAULT NULL COMMENT '系统标识',
